export function matchGENEDB(str) {
    if (str in GENEDB) {
        return GENEDB[str]
    } else {
        console.log("The given key [" + str + "] is not in the gene/breed database.")
        return { 'name': 'UNKNOWN', 'position': 'UNKNOWN', 'breed': 'UNKNOWN', 'rarity': '1', 'id': '0' }
    }
}

export function matchCOLORDB(str) {
    if (str in COLORDB) {
        return COLORDB[str]
    } else {
        console.log("The given key [" + str + "] is not in the color database.")
        return { 'name': 'UNKNOWN', 'id': 1, 'order': 1, 'hex': '#000000' }
    }
}

export function matchOTHER(str) {
    if (str in OTHERDB) {
        return OTHERDB[str]
    } else {
        console.log("The given key [" + str + "] is not in the other database.")
        return { 'name': 'UNKNOWN', 'id': 1, 'type': 'UNKNOWN' }
    }
}

export function parseScry(queryString) {
    let ret = {}
    const paramsString = queryString.split('?')[1].split('&auth')[0];
    const paramsArray = paramsString.split('&').map(param => {
        const [key, value] = param.split('=');
        return {
            [key]: parseInt(value)
        };
    });
    const paramsDictionary = Object.assign({}, ...paramsArray);
    console.log(paramsDictionary);

    ret.breed = matchGENEDB("Breed" + String(paramsDictionary["breed"]))
    ret.primary = { "gene": {}, "color": {} }
    ret.secondary = { "gene": {}, "color": {} }
    ret.tertiary = { "gene": {}, "color": {} }
    ret.primary.gene = matchGENEDB(ret.breed.breed + "Primary" + paramsDictionary["bodygene"])
    ret.secondary.gene = matchGENEDB(ret.breed.breed + "Secondary" + paramsDictionary["winggene"])
    ret.tertiary.gene = matchGENEDB(ret.breed.breed + "Tertiary" + paramsDictionary["tertgene"])
    ret.primary.color = matchCOLORDB(paramsDictionary["body"])
    ret.secondary.color = matchCOLORDB(paramsDictionary["wings"])
    ret.tertiary.color = matchCOLORDB(paramsDictionary["tert"])
    ret.sex = matchOTHER(paramsDictionary["gender"] + "Sex")
    ret.age = matchOTHER(paramsDictionary["age"] + "Age")
    ret.eyes = { "type": {}, "color": {} }
    ret.eyes.type = matchOTHER(paramsDictionary["eyetype"] + "Eyetype")
    ret.eyes.color = matchOTHER(paramsDictionary["element"] + "Element")
    console.log(ret)
    return ret;
}

export function getRarityPercent(a, b) {
    if((a.rarity-1) < 0 || (a.rarity-1) < 0){
        return 0
    }
    if((a.rarity-1) > 4 || (a.rarity-1) > 4){
        return 0
    }
    const rarityPercentages = [
        [50, 70, 85, 97, 99],
        [30, 50, 75, 90, 99],
        [15, 25, 50, 85, 98],
        [3, 10, 15, 50, 97],
        [1, 1, 2, 3, 50]
    ];
    return rarityPercentages[a.rarity - 1][b.rarity - 1];
}

export function getColorsBetween(min, max) {
    console.log("getColorsBetween(" + min + ", " + max + ")")
    const result = [];
    for (const colorId in COLORDB) {
        const color = COLORDB[colorId];
        if (color.order >= min && color.order <= max) {
            result.push(color);
        }
    }
    console.log(result)
    return result.sort((a, b) => a.order - b.order);
}

function createColorRange(m, d) {
    console.log("createColorRange")
    console.log(m)
    console.log(d)
    var max = (m.order > d.order) ? m.order : d.order;
    var min = (m.order < d.order) ? m.order : d.order;
    if (max - min < 89) {
        console.log("No color looping")
        return getColorsBetween(min, max);
    } else {
        console.log("Color loops")
        return [...getColorsBetween(max, 177), ...getColorsBetween(0, min)];
    }
}

export function colorRangeToString(momColor, dadColor, divider, font, numPerLine) {
    console.log("colorRangeToString")
    var range = createColorRange(momColor, dadColor);
    console.log(range)
    var r = "";
    r += "[font=" + font + "]";
    for (var i = 0; i < range.length; i++) {
        r += "[color=" + range[i].hex + "]" + divider + "[/color]"
        if ((i + 1) % numPerLine == 0) r += "\n";
    }
    r += "[/font]";
    return r;
}
